import {
  SideBarMenuButton,
  SideBarMenuName,
} from './SideBarMenuButtonStyles.elements';

import React from 'react';

const SideBarMenuItem = ({ data }) => {
  return data.map((e) => (
    <SideBarMenuButton onClick={e.onClick} key={e.name} to=''>
      <SideBarMenuName>{e.name}</SideBarMenuName>
      {e.bool ? (
        <div onClick={e.setFavorite({ isFav: 'false' })}>👍</div>
      ) : (
        <div onClick={e.setFavorite({ isFav: 'true' })}>👎</div>
      )}
    </SideBarMenuButton>
  ));
};

export default SideBarMenuItem;
